import React, { useState } from "react";

import FileDownload, {
  FileDownloadProps,
} from "../components/public/File/FileDownload";

export default {
  title: "Components/FileDownload",
  component: FileDownload,
};

const originalFilenames = ["Original Filename 1", "Original Filename 2"];
const data = [
  "data:application/octet-stream;base64,",
  "data:image/jpeg;base64,",
];
const outputFilenames = ["Output Me 1!.jpg", "HurrDurr.jpg"];
const files = [
  { name: originalFilenames[0], data: data[0] },
  { name: originalFilenames[1], data: data[1] },
];

const props: Partial<FileDownloadProps> = {
  name: "myFileDownload",
  step: 0,
  index: 0,
  files,
  outputFilenames,
};

const Template: React.FC<FileDownloadProps> = (props) => {
  const [state, setState] = useState([[{ cache: {}, input: [] }]]);

  return (
    <FileDownload
      {...props}
      masterStateCopy={state}
      setMasterState={setState}
    />
  );
};

export const WithOriginalFilenamesAndOutputFilenames = Template.bind({});
WithOriginalFilenamesAndOutputFilenames.args = props;

export const WithOriginalFilenamesOnly = Template.bind({});
WithOriginalFilenamesOnly.args = { ...props, outputFilenames: undefined };

export const WithOutuptFilenamesOnly = Template.bind({});
WithOutuptFilenamesOnly.args = { ...props, originalFilenames: undefined };

export const OnlyDataProp = Template.bind({});
OnlyDataProp.args = {
  ...props,
  outputFilenames: undefined,
  originalFilenames: undefined,
};
